import React from "react";
import AdminLayout from "../templates/AdminLayout";

const Admin = () => {
  return (
    <AdminLayout>
      <h2 className="text-lg font-semibold">Daftar Mahasiswa</h2>
    </AdminLayout>
  );
};

export default Admin;
